import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
return (
    <div className="navigation">
        <ul>
            <NavLink to="/">
                <li>premier test</li>
            </NavLink>
            <NavLink to="/about">
                <li>2eme test</li>
            </NavLink>
        </ul>
    </div>
);
};

export default Navigation;
